#include "http_parser.h"
#include <stdint.h>
#include <stdlib.h>
#include <string.h>

#ifdef __cplusplus
extern "C" {
#endif

int LLVMFuzzerTestOneInput(const uint8_t *data, size_t size) {
  if (size == 0) {
    return 0;
  }

  http_errno err = (http_errno)data[0];

  if (err < 0 || err >= HTTP_ERRNO_MAX) {
    return 0;
  }

  http_errno_name(err);

  return 0;
}

#ifdef __cplusplus
}
#endif

#include "http_parser.h"
#include <stdint.h>
#include <stdlib.h>

int LLVMFuzzerTestOneInput(const uint8_t *data, size_t size) {
  if (size < sizeof(unsigned)) {
    return 0; 
  }

  // Cast the first bytes of data to http_errno
  // We cast to unsigned first to suppress a cast-align warning; our input is unaligned.
  unsigned raw = *(unsigned *)data;
  enum http_errno err = (enum http_errno)(raw % 26);

  // Call the function-under-test here:
  http_errno_name(err);

  return 0;
}
